webpackJsonp([0x7d8fc43cbfa8],{345:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Bondor",author:"Stephen Bondor"}},markdownRemark:{id:"/Users/bondor/Desktop/Lambda/Projects/blog/src/pages/2019-3-8-labs-week-four/index.md absPath of file >>> MarkdownRemark",html:'<h2>Part 1 - Individual Accomplishments this Week</h2>\n<h4>Your team’s github contribution graph and your Github:</h4>\n<p><a href="https://github.com/StephenBondor">StephenBondor</a>\n— <a href="https://github.com/Lambda-School-Labs/labs-team-home/graphs/contributors">Team Contribution Graph</a></p>\n<h4>This week</h4>\n<p>This week we began the process of finalizing our feature set and refactoring it into the code base we inherited from the previous labs team. Our new deploy is <a href="https://team-home-2.netlify.com/">here</a>.</p>\n<blockquote>\n<blockquote>\n<p>List the tasks you pulled this week, and provide a link to the successfully merged PR completing that task and the trello card for that task. You must have at least one front end and one back end. The expected total is 6 with a minimum of 4.</p>\n</blockquote>\n</blockquote>\n<p><strong>Ticket 1</strong>\n<a href="https://github.com/Lambda-School-Labs/labs-team-home/pull/353">Github</a>\n<a href="https://trello.com/b/Ir0KPUDw/labs10-team-home-2">Trello</a>\n<strong>Ticket 2</strong>\n<a href="https://github.com/Lambda-School-Labs/labs-team-home/pull/354">Github</a>\n<a href="https://trello.com/b/Ir0KPUDw/labs10-team-home-2">Trello</a>\n<strong>Ticket 3</strong>\n<a href="https://github.com/Lambda-School-Labs/labs-team-home/pull/355">Github</a>\n<a href="https://trello.com/b/Ir0KPUDw/labs10-team-home-2">Trello</a>\n<strong>Ticket 4</strong>\n<a href="https://github.com/Lambda-School-Labs/labs-team-home/pull/363">Github</a>\n<a href="https://trello.com/b/Ir0KPUDw/labs10-team-home-2">Trello</a>\n<strong>Ticket 5</strong>\n<a href="https://github.com/Lambda-School-Labs/labs-team-home/pull/367">Github</a>\n<a href="https://trello.com/b/Ir0KPUDw/labs10-team-home-2">Trello</a>\n<strong>Ticket 6</strong>\n<a href="https://github.com/Lambda-School-Labs/labs-team-home/pull/374">Github</a>\n<a href="https://trello.com/b/Ir0KPUDw/labs10-team-home-2">Trello</a>\n<strong>Ticket 7</strong>\n<a href="https://github.com/Lambda-School-Labs/labs-team-home/pull/378">Github</a>\n<a href="https://trello.com/b/Ir0KPUDw/labs10-team-home-2">Trello</a>\n<strong>Ticket 8</strong>\n<a href="https://github.com/Lambda-School-Labs/labs-team-home/pull/380">Github</a>\n<a href="https://trello.com/b/Ir0KPUDw/labs10-team-home-2">Trello</a>\n<strong>Ticket 9</strong>\n<a href="https://github.com/Lambda-School-Labs/labs-team-home/pull/381">Github</a>\n<a href="https://trello.com/b/Ir0KPUDw/labs10-team-home-2">Trello</a>\n<strong>Ticket 10</strong>\n<a href="https://github.com/Lambda-School-Labs/labs-team-home/pull/383">Github</a>\n<a href="https://trello.com/b/Ir0KPUDw/labs10-team-home-2">Trello</a>\n<strong>Ticket 11</strong>\n<a href="https://github.com/Lambda-School-Labs/labs-team-home/pull/386">Github</a>\n<a href="https://trello.com/b/Ir0KPUDw/labs10-team-home-2">Trello</a>\n<strong>Ticket 12</strong>\n<a href="https://github.com/Lambda-School-Labs/labs-team-home/pull/392">Github</a>\n<a href="https://trello.com/b/Ir0KPUDw/labs10-team-home-2">Trello</a>\n<strong>Ticket 13</strong>\n<a href="https://github.com/Lambda-School-Labs/labs-team-home/pull/392">Github</a>\n<a href="https://trello.com/b/Ir0KPUDw/labs10-team-home-2">Trello</a>\n<strong>Ticket 14</strong>\n<a href="https://github.com/Lambda-School-Labs/labs-team-home/pull/394">Github</a>\n<a href="https://trello.com/b/Ir0KPUDw/labs10-team-home-2">Trello</a>\n<strong>Ticket 15</strong>\n<a href="https://github.com/Lambda-School-Labs/labs-team-home/pull/398">Github</a>\n<a href="https://trello.com/b/Ir0KPUDw/labs10-team-home-2">Trello</a>\n<strong>Ticket 16</strong>\n<a href="https://github.com/Lambda-School-Labs/labs-team-home/pull/403">Github</a>\n<a href="https://trello.com/b/Ir0KPUDw/labs10-team-home-2">Trello</a></p>\n<h4>Detailed Analysis</h4>\n<blockquote>\n<blockquote>\n<p>Pick one of your tickets and provide a detailed analysis of the work you did. This should be approximately ¼ page of text, and at least three screenshots.</p>\n</blockquote>\n</blockquote>\n<h5>Refactoring the Activity Timeline</h5>\n<p>As we worked through adding our own component to this website, we quickly came to realize that the present implementation of the Activity Timeline tab was more a loose interpretation of “Activity” than it was a strong one. As such, someone could perform the activity of creating something, and the activity timeline would reflect that:</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 700px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 24.512195121951223%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Old Website"\n        title=""\n        src="/static/Screen_Shot_2019-03-08_at_8.49.38_AM-ee84a11e7ccc008373bbd3002d4eaba6-e3b29.png"\n        srcset="/static/Screen_Shot_2019-03-08_at_8.49.38_AM-ee84a11e7ccc008373bbd3002d4eaba6-6572b.png 175w,\n/static/Screen_Shot_2019-03-08_at_8.49.38_AM-ee84a11e7ccc008373bbd3002d4eaba6-e1ddf.png 350w,\n/static/Screen_Shot_2019-03-08_at_8.49.38_AM-ee84a11e7ccc008373bbd3002d4eaba6-e3b29.png 700w,\n/static/Screen_Shot_2019-03-08_at_8.49.38_AM-ee84a11e7ccc008373bbd3002d4eaba6-1eceb.png 1050w,\n/static/Screen_Shot_2019-03-08_at_8.49.38_AM-ee84a11e7ccc008373bbd3002d4eaba6-f5de9.png 1400w,\n/static/Screen_Shot_2019-03-08_at_8.49.38_AM-ee84a11e7ccc008373bbd3002d4eaba6-7bb5b.png 1640w"\n        sizes="(max-width: 700px) 100vw, 700px"\n      />\n    </span>\n  </span>\n  <em>A New Message hits the activity timeline</em></p>\n<p>However, when someone performed an activity like <code class="language-text">edit</code> or <code class="language-text">delete</code>, the activity timeline would not display this information. And what is more, in some cases it would no longer show the original activity. For instance, if someone went back and deleted the previously made message the new activity timeline would be reflected as such:</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 700px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 25.127551020408163%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Old Website"\n        title=""\n        src="/static/Screen_Shot_2019-03-08_at_8.49.54_AM-487ae7aa38fb960c25f24da2bea5ef81-e3b29.png"\n        srcset="/static/Screen_Shot_2019-03-08_at_8.49.54_AM-487ae7aa38fb960c25f24da2bea5ef81-6572b.png 175w,\n/static/Screen_Shot_2019-03-08_at_8.49.54_AM-487ae7aa38fb960c25f24da2bea5ef81-e1ddf.png 350w,\n/static/Screen_Shot_2019-03-08_at_8.49.54_AM-487ae7aa38fb960c25f24da2bea5ef81-e3b29.png 700w,\n/static/Screen_Shot_2019-03-08_at_8.49.54_AM-487ae7aa38fb960c25f24da2bea5ef81-1eceb.png 1050w,\n/static/Screen_Shot_2019-03-08_at_8.49.54_AM-487ae7aa38fb960c25f24da2bea5ef81-f5de9.png 1400w,\n/static/Screen_Shot_2019-03-08_at_8.49.54_AM-487ae7aa38fb960c25f24da2bea5ef81-73219.png 1568w"\n        sizes="(max-width: 700px) 100vw, 700px"\n      />\n    </span>\n  </span>\n  <em>The Activity Timeline after performing two activities: 1. Create Message, and 2. Delete Message</em></p>\n<p>As is probably obvious to the ready, the reason the activity timeline does is this because it is jsut reading the date entries on the database and returning them in order. Thus, if something is deleted, it no longer exists in the database, and thus <em>can not</em> exist on the Activity Timeline. Which is to say, the old Activity Timeline simply printed the state of the database in chronological order. In my opinion, this implementation of this tab is less of an “Activity Timeline,” and more of a “Current State of the Team”</p>\n<p>So, we refactored it.</p>\n<p>Our solution to this problem was to create a new Event Schema in the database. We then wrapped all other events in the Resolvers with a type of event listener which would populate this new model with <code class="language-text">new Event</code> entries every time a user interacted with the site.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 700px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 91.77304964539006%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="New Code"\n        title=""\n        src="/static/Screen_Shot_2019-03-08_at_9.10.26_AM-a2d7dc76766f15dbd66311b15cff4348-e3b29.png"\n        srcset="/static/Screen_Shot_2019-03-08_at_9.10.26_AM-a2d7dc76766f15dbd66311b15cff4348-6572b.png 175w,\n/static/Screen_Shot_2019-03-08_at_9.10.26_AM-a2d7dc76766f15dbd66311b15cff4348-e1ddf.png 350w,\n/static/Screen_Shot_2019-03-08_at_9.10.26_AM-a2d7dc76766f15dbd66311b15cff4348-e3b29.png 700w,\n/static/Screen_Shot_2019-03-08_at_9.10.26_AM-a2d7dc76766f15dbd66311b15cff4348-1eceb.png 1050w,\n/static/Screen_Shot_2019-03-08_at_9.10.26_AM-a2d7dc76766f15dbd66311b15cff4348-f5de9.png 1400w,\n/static/Screen_Shot_2019-03-08_at_9.10.26_AM-a2d7dc76766f15dbd66311b15cff4348-0886f.png 1410w"\n        sizes="(max-width: 700px) 100vw, 700px"\n      />\n    </span>\n  </span>\n  <em>Adding an Event</em></p>\n<p>The above code needed to be applied to over 30 events. Which was pretty <em>not dry</em> and painful, but the computer science necessary to do it more efficiently is def beyond us at this point in our education. However, once completed, it radically improved the efficiency on the front end processing. Instead of having to make 7 queries into the database using graphQL, now, only one query was needed to populate the entire Activity Timeline, and that activity was a historical representation of everything that has happened to a team.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 700px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 47.44897959183674%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="New Website"\n        title=""\n        src="/static/Screen_Shot_2019-03-08_at_8.52.29_AM-9fa4cdb1385ffafd544563883db9daea-e3b29.png"\n        srcset="/static/Screen_Shot_2019-03-08_at_8.52.29_AM-9fa4cdb1385ffafd544563883db9daea-6572b.png 175w,\n/static/Screen_Shot_2019-03-08_at_8.52.29_AM-9fa4cdb1385ffafd544563883db9daea-e1ddf.png 350w,\n/static/Screen_Shot_2019-03-08_at_8.52.29_AM-9fa4cdb1385ffafd544563883db9daea-e3b29.png 700w,\n/static/Screen_Shot_2019-03-08_at_8.52.29_AM-9fa4cdb1385ffafd544563883db9daea-1eceb.png 1050w,\n/static/Screen_Shot_2019-03-08_at_8.52.29_AM-9fa4cdb1385ffafd544563883db9daea-f5de9.png 1400w,\n/static/Screen_Shot_2019-03-08_at_8.52.29_AM-9fa4cdb1385ffafd544563883db9daea-73219.png 1568w"\n        sizes="(max-width: 700px) 100vw, 700px"\n      />\n    </span>\n  </span>\n  <em>The Activity Timeline after performing two activities: 1. Create Message, and 2. Delete Message</em></p>\n<hr>\n<blockquote>\n<p>As a part of your journal entry, write ¼ to ½ a page reflecting on your experiences working with a team to make your product look and feel as good as it works under the hood. Describe how the duties of you and your team shifted tasks shifted towards the front end - and debugging the back end to improve UX.</p>\n</blockquote>\n<p>See above. That said, debugging 30+ unique event entries on the back end was not easy or fun. But in the end, it radically improved the end user experience.</p>\n<blockquote>\n<p>As a group, provide documentation of your progress and remaining tasks:\nLink to each page and describe any remaining bugs, fixes, or tasks that need to be completed on that page</p>\n</blockquote>\n<p><a href="https://github.com/Lambda-School-Labs/labs-team-home/blob/labs10-master/frontend/FRONTEND_BUG_REPORT.md">Running Front End bug list</a></p>',excerpt:"Part 1 - Individual Accomplishments this Week Your team’s github contribution graph and your Github: StephenBondor \n—  Team Contribution Graph This week This week we began the process of finalizing our feature set and refactoring it into the code base we inherited from the previous labs team. Our new deploy is  here…",frontmatter:{title:"Labs Week Four",date:"Invalid date",path:"/labs-week-four"}}},pathContext:{}}}});
